import './App.css';

function App() {
  return (
    <div className="App">
        <div className="navbar" id="topNavBar"></div>
        <h1 id="title">Reminders.py</h1>
        <ul id="reminders">
            <li>1</li>
        </ul>
    </div>
  );
}

export default App;
